import React from 'react';
import axios from 'axios';

const KEY = 'AIzaSyCI1DxgfzVROLzqNpCz0BKbBVnzwVIlRRs';
// Pre configured axios
export default axios.create({
    baseURL: 'https://www.googleapis.com/youtube/v3',
    params: {
        part: 'snippet',
        type: 'video',
        maxResults: '5',
        key: KEY
    }
});
